import {
  makeStyles,
  TableHead,
  Table,
  Paper,
  TableCell,
  TableRow, TableBody, FormControlLabel, Switch, Button
} from "@material-ui/core";
const useStyles = makeStyles({
  root: {
    width: "100%",
    margin: "100px 0 0 0 ",
    textAlign:"center",
    margin:"0 auto"
  },
  paper:{
    textAlign:"center",
    margin:"0 auto",
    width:"800px",
  },
  title: {
    fontSize:"20px",
    padding:"20px 0"
  },
  head:{
    fontSize:"16px",
  }
});
export default function InputTodoList() {
  const classes = useStyles();

  return   (<div className={classes.root}>
  <Paper className={classes.paper}>
    <h3 className={classes.title}>TODO LIST</h3>

  </Paper>
</div>);
}
